INSERT INTO Clinic.Clinic
SELECT DISTINCT CT.ClinicLoc, CT.FormDate, CT.FormDate
FROM #clinic_temp CT;

INSERT INTO Clinic.ClinicVisit(SubjectID,[Date],ClinicianID, ClinicID,RecordID,BodyTempDegC,WeightKG,PercentBodyFat,HeightCM,WBCCount,IsPregnant,TobaccoUse,AlcoholUse,NumberLivingChildren,IsFatherAlive,IsMotherAlive,XRayImageFile)
SELECT S.SubjectID, CT.FormDate, C.ClinicianID, CLIN.ClinicID, CT.FormNum, BodyTemp, Wt, PercFat,Ht,WBC,Preg,Tobacco,Alcohol,NumKidsLive,FatherAlive,MotherLive,XrayFile
FROM #clinic_temp CT 
    LEFT JOIN [Subject].[Subject] S ON S.OAHeLPID = CT.OAID
    LEFT JOIN Clinic.Clinician C ON C.LastName = CT.Clinician
    LEFT JOIN Clinic.Clinic CLIN ON CT.FormDate BETWEEN CLIN.DateStarted AND CLIN.DateCompleted AND CLIN.SiteName = CT.ClinicLoc


